tables.table_schema:
CREATE TABLE StudentProgression (
 id INT PRIMARY KEY,
 student_id INT,
 progress VARCHAR(255),
 achieved_marks INT
);

CREATE TABLE EducationalPlanning (
 id INT PRIMARY KEY,
 planning_id INT,
 planning_name VARCHAR(255),
 decision_making VARCHAR(255)
);

CREATE TABLE students (
    student_id INT PRIMARY KEY,
    student_name VARCHAR(50),
    class_id INT,
    student_grade VARCHAR(5)
);

CREATE TABLE classes (
    class_id INT PRIMARY KEY,
    class_name VARCHAR(50),
    teacher_id INT
);

CREATE TABLE grades (
    grade_id INT PRIMARY KEY,
    student_id INT,
    class_id INT,
    grade DECIMAL(5, 2)
);

CREATE TABLE student_progress (
  student_id INT,
  student_name VARCHAR(255),
  subject VARCHAR(100),
  marks INT
);

CREATE TABLE courses (
  course_id INT,
  course_name VARCHAR(255),
  instructor_name VARCHAR(100),
  department VARCHAR(100)
);

CREATE TABLE enrollments (
  student_id INT,
  course_id INT,
  enrollment_date DATE
);

CREATE TABLE reports (
  report_id INT,
  student_id INT,
  report_date DATE,
  grade VARCHAR(2)
);
